(86651, 'esMX', '[DNT] Test', '', '', '', '', '', '', '', '', 58162),
(86619, 'esMX', 'Troupe de teatro', '', '', '', '', '', '', '', '', 58162),
(86556, 'esMX', 'Un viaje destrozado a través del tiempo', 'Completa 5 calabozos de cronoviaje.', 'La estrella del Destructor brilla sobre la tierra con su penetrante luz e incluso los espíritus se ocultan en las sombras. Esta estrella es diferente de todas las otras del cielo, pues pone al descubierto las flaquezas de incluso los héroes más intrépidos. Mientras tenga influencia, podrán abrirse nuevos caminos a lugares lejanos e incluso a tiempos distantes. Ningún sabio comprende realmente la naturaleza de esta señal, pero la fortuna favorece a los valientes.', '', '', '', '', '', '', 58162),
(86496, 'esMX', 'Un diseño ordenado', 'Recoge $1oa escombros con fragmentos cristalinos.\n\nPuedes conseguirlos de las criaturas que se encuentran en la Isla de las Sirenas.', '<Bargus sostiene una esquirla pequeña de cristal dorado.>\n\nAl igual que los remanentes radiantes que encontraron los arathi en Cristalia, el Cristal de las Sirenas parece afectar la matriz geológica circundante de la isla.\n\nA diferencia de nuestros compatriotas goblins, no me atrevería a sugerir recolectar los fragmentos grandes que hemos visto en la isla por miedo a perturbar las frágiles cavernas bajo nuestros pies u ofender a los arathi. \n\nPero vale la pena estudiar estas esquirlas pequeñas.\n\nTráeme una cantidad considerable. Para... fines experimentales.', '', '', '', '', '', '', 58162),
(86494, 'esMX', 'LFGDungeons - Timewalking \"Heroic\" Random - Nth', '', '', '', '', '', '', '', '', 58162),
(86493, 'esMX', 'LFGDungeons - Timewalking \"Heroic\" Random - 1st', '', '', '', '', '', '', '', '', 58162),
(86482, 'esMX', 'Un soplo de vida', 'Habla con Zexel Chasquido.', '<El boca de dragón apenas se mueve cuando te acercas. Se lo nota muy débil y mucho más pequeño de lo que debería ser. \n\nPuede que Zexel Chasquido tenga a la venta algún producto que lo ayude a recuperarse.>', '', '', '', '', '', '', 58162),
(86261, 'esMX', 'De camino a costas más seguras', 'Acaricia al perrito más adorable.', '<Cuando te ve llegar al campamento, un perro sucio y de pelaje enmarañado se emociona. Empieza a mover la cola al ver la cara familiar de quien encontró su juguete favorito.\n\nLleva un collar desgastado en el cuello que dice \"El Rey\".\n\nAl parecer, ha estado aquí desde que los kultiranos desaparecieron y se las ha arreglado para sobrevivir a los numerosos peligros de la isla.\n\n\"El Rey\" te mira con anhelo y golpea tu mano con el hocico en busca de afecto.>', '', '', '', '', '', '', 58162),
(86174, 'esMX', 'Asignación especial: Formación de tormenta', '', '', '', '', '', '', '', '', 58162),
(86156, 'esMX', 'Mayor compromiso', 'Contribuye $1oa veces a los eventos en el mapa del comando de la Isla de las Sirenas y mata a un objetivo para completar un evento.', 'Tú. Haz eso de nuevo. Podría haber cosas interesantes que aún no hemos visto. \n\n¡Abre esas cuevas y mira qué hay dentro!', '', '', '', '', '', '', 58162),
(85949, 'esMX', 'Un viaje helado a través del tiempo', 'Completa 5 calabozos de cronoviaje.', 'La estrella fría brilla sobre la tierra con su gélida luz e incluso los espíritus se ocultan en las sombras. Esta estrella es diferente de todas las otras del cielo, pues absorbe el calor y la vida. Mientras tenga influencia, podrán abrirse nuevos caminos a lugares lejanos e incluso a tiempos distantes. Ningún sabio comprende realmente la naturaleza de esta señal, pero la fortuna favorece a los valientes.', '', '', '', '', '', '', 58162),
(85936, 'esMX', 'Ancestra Ikk\'xataz', '', '', '', '', '', '', '', '', 58162),
(85935, 'esMX', 'Ancestra Ikk\'zivan', '', '', '', '', '', '', '', '', 58162),
(85934, 'esMX', 'Ancestra Jurapactos', '', '', '', '', '', '', '', '', 58162),
(85933, 'esMX', 'Ancestro Knythall', '', '', '', '', '', '', '', '', 58162),
(85932, 'esMX', 'Archivista Silsigra', '', '', '', '', '', '', '', '', 58162),
(85931, 'esMX', 'Archivista Farolt', '', '', '', '', '', '', '', '', 58162),
(85930, 'esMX', 'Archivista Cobremusgo', '', '', '', '', '', '', '', '', 58162),
(85929, 'esMX', 'Archivista Brillaescombros', '', '', '', '', '', '', '', '', 58162),
(85876, 'esMX', 'Lectura de runas', 'Examina varias tablillas grabadas con runas dentro de la Tumba Olvidada.', 'Mi curiosidad aún no está satisfecha, $n. Quisiera saber más sobre estos vrykuls y por qué vinieron a esta tierra.\n\n<Las cejas hirsutas de Bargus se levantan y se unen, y su bigote se eriza mientras piensa.>\n\nLas tablillas que encontraste fueron por lejos la mejor fuente de información sobre los vrykuls y quienquiera que sea esta \"Cyrce\".\n\n¿Quizás haya más tablillas que no vimos?\n\nTengo mis deberes ordenados aquí, pero por favor analízalas y vuelve a informarme.', '', '', '', '', '', '', 58162),
(85811, 'esMX', 'Thrayir, Ojos de la sirena', 'Acepta a Thrayir, Ojos de la sirena.', '<El poder de la tormenta ha reformado a Thrayir, Ojos de la Sirena. Espera que aceptes.>', '', '', '', '', '', '', 58162),
(85765, 'esMX', 'Foso Tembloroso', '', '', '', '', '', '', '', '', 58162),
(85764, 'esMX', 'Foso Tembloroso', '', '', '', '', '', '', '', '', 58162),
(85762, 'esMX', 'La Guarida Anegada', '', '', '', '', '', '', '', '', 58162),
(85760, 'esMX', 'La Guarida Anegada', '', '', '', '', '', '', '', '', 58162),
(85755, 'esMX', 'El Drenaje', '', '', '', '', '', '', '', '', 58162),
(85753, 'esMX', 'El Drenaje', '', '', '', '', '', '', '', '', 58162),
(85716, 'esMX', 'Lanza de abrasamiento rúnico', 'Lleva la lanza de abrasamiento rúnico a Angorla, en Cardumen de Naufragios.', '<Una elaborada lanza cubierta de runas. Angorla podría estar interesada en estudiar esta arma.>', '', '', '', '', '', '', 58162),
(85573, 'esMX', 'Finalmente, un descanso', 'Lleva el diario kultirano andrajoso al cementerio que está detrás de la base Kul Tiran, en las Minas Abandonadas.', '<Stellin te escucha mientras explicas lo que averiguaste y asiente con seriedad.>\n\nEste pobre hombre formaba parte de una tripulación que navegó hasta aquí a bordo de una nave llamada Susurro de la Doncella. Se desató una tormenta que casi los aniquila, pero, luego, ¡hasta los sobrevivientes desaparecieron!\n\nÉl fue el último y... finalmente no sobrevivió. Tal vez podamos darle un merecido descanso a su memoria.\n\nVi un cementerio detrás de la base kultirana... Quizá si dejamos el diario ahí, con su tripulación, pueda descansar en paz.', '', '', '', '', '', '', 58162),
(85572, 'esMX', 'Esfuerzo grupal', 'Pregúntales a Altain, Rapidina y Ricket si pueden leer el diario.', 'Esto que me has dado... mmm... es todo un caos. Todas estas páginas... ¿en qué orden van? \n\n¡Ajá!\n\nParece que este diario le perteneció a uno de los kultiranos que vino aquí...\n\n<Stellin levanta la mirada y te observa con ojos llenos de emoción.>\n\n... Y puede que sea la clave para conocer la historia de su vida en la isla. \n\nPero las páginas son difíciles de leer... Quizá debamos preguntar a otras personas si pueden leerlas.\n\nToma, llévate algunas páginas. Yo me quedaré para tratar de descifrar el diario desarmado mientras tú vas al campamento y consultas por ahí.', '', '', '', '', '', '', 58162),
(85571, 'esMX', 'Hojas en el viento', 'Recoge 5 páginas de diario desgastadas en la isla.', '¡Qué barbaridad! ¡Le faltan muchas páginas! \n\n<Stellin hojea el diario con cuidado para que no se caigan las páginas sueltas.>\n\nEste diario no se ve tan viejo... y al parecer es de origen humano. ¿Será la clave para descubrir lo que les pasó a los humanos que vinieron aquí? ¡Qué misterio!\n\nPero sería menos misterioso si pudiéramos encontrar las páginas que faltan... Mientras exploras, ¿podrías estar $gatento:atenta; para ver si encuentras más páginas?', '', '', '', '', '', '', 58162),
(85570, 'esMX', 'El diario andrajoso', 'Lleva el diario a Stellin Verasa en el campamento de la Isla de las Sirenas.', '<El diario prácticamente se deshace en tus manos mientras lo hojeas. \n\nParece haber unos garabatos erráticos en las pocas páginas que quedan.\n\nPuede que a Stellin Verasa le interese leerlo en el campamento.>', '', '', '', '', '', '', 58162),
(85560, 'esMX', 'TEST', '', '', '', '', '', '', '', '', 58162),
(85503, 'esMX', 'Una investigación sorprendente', 'Resuelve el caso que te asignó el detective Jones.', 'Bueno, miren quién ha vuelto a resolver más casos.\n\nParece que Cromi ha manipulado el tiempo nuevamente, y ahora aparecieron unos impostores en la zona de la celebración.\n\nSolo tienes que identificar a los que no pertenezcan aquí y enviarlos con Cromi. No creo que te resulte muy difícil a ti.', '', '', '', '', '', 'Habla con Alyx en Playa Baile de las Olas.', 58162),
(85502, 'esMX', 'Reflejos festivos', 'Habla con el detective Jones.', 'Ah, bien, has vuelto. Tengo mucho para hacer, y el detective Jones necesita tu ayuda con un caso nuevo.\n\nNo parece importar... A pesar de todo lo que hacemos por los invitados, ¡parece que esta fila, si todavía se la puede llamar así, no hizo nada más que crecer!\n\nTengo que volver al trabajo. Tú deberías hablar con el detective Jones.', '', '', '', '', '', '', 58162),
(85477, 'esMX', 'Objetos perdidos ¿y encontrados?', 'Entrega los objetos perdidos a sus respectivos dueños.', 'Me va a estallar la cabeza. Hace un rato vino un grupo a quejarse... digo, a denunciar objetos perdidos con mucho ímpetu, pero todos al mismo tiempo. \n\nIntenté tomar nota de todos los detalles, pero me temo que la presión del momento hizo que me confundiera.\n\nTengo esta colección de objetos que se encontraron a lo largo del día, y creo que son los que reclamó este grupo. ¿Echarías un vistazo a mis notas para ver a quién le pertenece cada objeto?', '', '', '', '', '', '', 58162),
(85476, 'esMX', 'Tesodo enterrado', 'Encuentra el tesoro enterrado.', '¡Hola, $gamigo:amiga;! No lo podás creer, pero ¡me dijeron que hay un tesodo oculto en Tanaris!\n\nSoy taaan sigilosa que conseguí una copia del pimer acedtijo. ¡Y tú eres tan hábil descifrándolos que te la quiedo dar a ti!', '', '', '', '', '', 'Vuelve con Maru afuera de las Cavernas del Tiempo.', 58162),
(85475, 'esMX', 'Secreto en la arena', 'Habla con Maru.', 'Me alegra volver a verte. Maru te está buscando de nuevo. Dice que solo tú podrás ayudarla con esta tarea.\n\n<Sube el volumen de las quejas y reclamos de la multitud.>\n\nAh, no te preocupes por mí. Estaré aquí... como siempre...', '', '', '', '', '', '', 58162),
(85139, 'esMX', '[PH]', '[PH] Extract the -insert gem here- from your equipment.', '[PH] Any gem can be removed from your Cyrce\'s Circlet by clicking on them.\n\nThe gem will not be destroyed.\n\nExtract a gem now.', '', '', '', '', '', '', 58162),
(85113, 'esMX', 'Asignación especial: Formación de tormenta', '', '', '', '', '', '', '', '', 58162),
(85059, 'esMX', 'Una tajada', 'Contribuye en un evento en el mapa del comando de Isla de las Sirenas.', 'Juego en mesa verse divertido. Pero Skaggit no querer que Jack juegue. ¿Tal vez tú poder?\n\nTú ir ahí y hacer una apuesta. ¡Ya veremos quién gana!', '', '', '', '', '', '', 58162),
(84985, 'esMX', 'Manos a la obra', 'Busca a Gallárdez en Ardenweald.', 'Ah, $n, me alegra volver a verte.\n\nMis superiores me han informado que no solo debo encargarme de los invitados, ¡sino que, además, debo ayudar a todos los organizadores las celebraciones!\n\nY ahora me han dicho que Gallárdez está intentando montar una obra nueva en Ardenweald, pero surgieron inconvenientes.\n\n¿Te molestaría echar un vistazo? Yo no doy abasto con todo. Esta celebración ya me tiene de aquí para allá, ¡no puedo ni pensar en ir a las Tierras de las Sombras!', '', '', '', '', '', 'Busca a Gallárdez en Ardenweald.', 58162),
(84941, 'esMX', 'Entrada a la cueva', 'Encuentra la fuente de la señal de energía.', 'No sé quiénes serán estos forasteros enormes, pero, a menos que sea una coincidencia, también parecen interesados en encontrar la ubicación de la señal del cristal... y de su origen.\n\nEn líneas generales, los terráneos no creemos en las coincidencias.\n\nActiva tus protocolos de defensa, $n. \n\nEstos forasteros no son hospitalarios como ustedes.', '', '', '', '', '', '', 58162),
(84940, 'esMX', 'Competencia amistosa', 'Busca a Bargus en el campamento.', 'Ricket se ofreció a desenterrarlo, pero la señora de la expedición arathi no parecía muy entusiasmada.\n\nLe dijo de todo, se podía oír desde la nave. Uf.\n\nBargus, el \"ordenante\" terráneo, sea lo que sea eso, propuso escanear el cristal para ayudarnos a \"comprenderlo mejor\".\n\nYo no necesito comprenderlo. Solo necesito mi parte. Pero estoy bien manteniendo un perfil bajo y haciendo lo que ellos quieren. \n\nVe al campamento terráneo a hablar con Bargus. Averigua cómo les está yendo y si necesitan ayuda.', '', '', '', '', '', '', 58162),
(84924, 'esMX', 'Una historia escrita con pluma', 'Encuentra las plumas de Percy para saber más sobre sus aventuras.', 'He contado muchas historias a lo largo de mi vida, pero mi compañero Percy tiene una propia para relatar. ¿Te gustaría conocerla?\n\nTe daré una pista para que sepas por dónde empezar. Luego, tendrás que encontrar las pistas que dejó Percy para descubrir su historia.\n\nToma esta pluma que dejó Percy. Presta atención y encontrarás más pistas. Puede que contar con tu propio pájaro te sea útil en el camino.', '', '', '', '', '', 'Vuelve con Reshad en las afueras de las Cavernas del Tiempo cerca del escenario.', 58162),
(84923, 'esMX', 'La historia de un pajarito', 'Busca a Reshad cerca del escenario.', 'Oí que Reshad tiene una nueva historia para contar que involucra a su pájaro compañero, Percy. Habla con él si te interesa escuchar la historia.', '', '', '', '', '', 'Busca a Reshad cerca del escenario.', 58162),
(84912, 'esMX', 'El espectáculo debe continuar', 'Ayuda a Gallárdez en el anfiteatro de Ardenweald.', '¡Gracias por venir! Tuvimos un problema con el guion y la utilería del escenario.\n\n¡Desapareció todo! Parece que alguien ha decidido burlarse de nuestra producción y esparcir por toda la zona los objetos que necesitamos.\n\nQuienquiera que haya sido al menos tuvo la consideración de dejarnos algunas pistas para encontrarlos. ¿Crees que podrías resolver los acertijos?\n\nY, por favor, nada de llamas o luces brillantes en el teatro.', '', '', '', '', '', '', 58162),
(84909, 'esMX', 'Cajón de festejo fantasmal', 'Devuelve el cajón de festejo fantasmal a Alyx.', '<El cajón emite une brillo fantasmagórico, y sientes la presencia de espíritus misteriosos. Alyx agradecería que le devolvieran los suministros.>', '', '', '', '', '', '', 58162),
(84852, 'esMX', 'Legado de los Vrykul', '', '', '', '', '', '', '', '', 58162),
(84781, 'esMX', 'El amo de los secretos', '', '', '', '', '', '', '', '', 58162),
(84731, 'esMX', 'Storm Breadcrumb', '', '', '', '', '', '', '', '', 58162),
(84730, 'esMX', 'Un deber inquebrantable', 'Recoge $1oa escombros erosionados.\n\nPuedes conseguirlos de las criaturas que se encuentran en la Isla de las Sirenas.', 'El material inorgánico de esta isla es bastante peculiar. Los efectos del agua salada y los años de erosión a causa de las tormentas han enriquecido los minerales de este lugar.\n\nY los minerales enriquecidos son exactamente el tipo de material que un ordenante necesita para infundir en nuevos armamentos.\n\nTráeme una buena cantidad de escombros erosionados de las incontables criaturas que habitan la isla. Me gustaría ver si sirven para mi trabajo.', '', '', '', '', '', '', 58162),
(84728, 'esMX', 'Reforjado de cero', 'Ayuda a Angorla a reparar el citrino.', 'El citrino rajado que encontraste parece encajar perfectamente en una de las ranuras que se encuentran en el anillo, pero ...\n\n<Cuando Angorla coloca el fragmento en el anillo, el citrino se mueve y sale despedido.>\n\nEl anillo parece rechazar la pieza. Si podemos reparar el citrino y estabilizar la energía dentro del fragmento, ¿tal vez el anillo lo acepte?\n\nYa que le has sido de tanta ayuda Bargus, ¿te gustaría darme un mano?', '', '', '', '', '', '', 58162),
(84727, 'esMX', 'La segunda señal', 'Sigue a Bargus al norte.', 'Un suceso inesperado. \n\nLa señal de energía parece tener una fuente secundaria, y está al norte de aquí.\n\nCuriosidad activada.\n\nA juzgar por el tamaño estimado del cristal, teorizo que puede ser una faceta secundaria expuesta.\n\nSe requiere mayor investigación. Sígueme.', '', '', '', '', '', '', 58162),
(84726, 'esMX', 'Misterios descubiertos', 'Descubre secretos ocultos alrededor de la Isla de las Sirenas.', '<Angorla toma tu mano entre las suyas y examina de cerca el cristal engarzado en la sortija.>\n\n¿Sientes la energía que resuena en su interior, $n? La sortija se siente... despierta. \n\nTal vez haya más secretos por la isla, a la espera de que los descubras.\n\nAlba nos alentó a explorar y aprender sobre esta isla, pero tengo mucho trabajo por delante aquí.\n\n¿Por qué no te fijas qué otros secretos puedes encontrar?', '', '', '', '', '', '', 58162),
(84725, 'esMX', 'El aro llama', 'Equipa la sortija de Cyrce y coloca el citrino rúnico de vientocantor en la ranura viento cantante.\n\nLuego, retira el citrino rúnico de vientocantor de la ranura.', '<Angorla te mira sobre sus gafas con emoción.>\n\n¿Lo oyes, $n?\n\nEste pequeño y humilde citrino está llamando a la sortija... tal como el Cristal de las Sirenas te llamó a ti y a todos nosotros.\n\nNo estoy segura de lo que sucederá cuando los reunifiques... pero solo hay una manera de averiguarlo.\n\nColoca la sortija en tu dedo y acomoda el citrino en el engaste.', '', '', '', '', '', '', 58162),
(84724, 'esMX', 'La bóveda radiante', 'Investiga el santuario del cristal', 'Esta bóveda... este cristal...\n\n¿Quiénes construyeron este lugar? ¿Quiénes vivían aquí? ¿Y quién es esta \"Cyrce\" que tanto mencionan en las tablillas?\n\nCuando empezamos a investigar sobre el cristal, no esperaba descubrir los restos de una civilización antigua en las profundidades de la tierra.\n\n<Bargus atusa su bigote hirsuto y te mira.>\n\nEsto exige una examinación más detallada, ¿no crees?', '', '', '', '', '', 'Reúnete con Bargus en Cardumen de Naufragios.', 58162),
(84723, 'esMX', 'Secretos enterrados', 'Investiga las ruinas y busca la fuente de la señal.', 'Estas ruinas son... bastante antiguas. Bueno, antiguas para el estándar de muchos forasteros.\n\nPor lo que surge la pregunta: ¿será que el objetivo de los forasteros hostiles consistía en buscar esta cámara o buscaban la tablilla?\n\nUna pista es que mis lecturas sugieren que la energía fluye a través de la tablilla como si fuera un conducto, en lugar de originarse ahí.\n\n¿Investigamos con más atención?\n\nQuizá la investigación nos brinde algunas respuestas, además de la fuente de las lecturas de energía.', '', '', '', '', '', '', 58162),
(84722, 'esMX', 'Señales cristalinas', 'Reúnete con junto al cristal y ayúdalo a erigir los pilones.', '¡Qué intriga! \n\nParece que estos remanentes radiantes de los arathi le dieron a nuestro dispositivo la direccionalidad que necesitaba. Solo resta armonizarlo adecuadamente para su tamaño.\n\nPara armonizarlo con la señal, tendremos que preparar unos pilares por la zona.\n\nTenemos que iniciar las pruebas, $n. Sígueme si quieres ayudarme.', '', '', '', '', '', '', 58162),
(84721, 'esMX', 'Escanear un cristal', 'Recoge el prototipo de los terráneos, el enfoque de los arathi y la fuente de energía de los goblins para ayudar a Bargus.', 'Si queremos comprender los misterios sobre el \"cristal cantante\" del centro de la isla, vamos a necesitar maquinaria especial.\n\nFabricamos un dispositivo para escanear las facetas expuestas, pero las energías del cristal son demasiado complejas de leer. Tiene una señal de energía muy inusual.\n\nParece que los goblins y los arathi quieren colaborar, así que avancemos con su ayuda.\n\nToma mi caja de herramientas y trae el prototipo y los componentes que los arathi y los goblins han preparado.', '', '', '', '', '', '', 58162),
(84720, 'esMX', '¡A la Isla de las Sirenas!', 'Habla con Skaggit para viajar a la Isla de las Sirenas', 'La Isla de las Sirenas es un misterio. Uno que podría ser muy beneficioso.\n\nMi tripulación creyó que habían dado con un tesoro cuando encontraron una isla desierta con un extraño cristal cantante...\n\nPero resulta que todos en Dornogal están interesados en \"extraños cristales cantantes\" sin dueño. ¡Tanto los arathi como los terráneos se organizaron y partieron antes de que pudiéramos reservar un zepelín!\n\nPor suerte, Ricket y su tripulación se adelantaron y prepararon todo.\n\nSomos los últimos en partir, y me muero de ganas de ir. ¿Qué estamos esperando?', '', '', '', '', '', '', 58162),
(84719, 'esMX', 'La expedición espera', 'Reúnete con Skaggit junto a la puerta este de Dornogal.', '¡Hola, $n! ¿Viniste a responder el llamado a la aventura de la Isla de las Sirenas?\n\nHace poco, un equipo de rescate de goblins descubrió una isla que tiene un extraño \"cristal cantante\" en el centro.\n\nAl igual que los goblins, tanto mi pueblo como los Arathi de Cristalia hemos mostrado un gran interés por este cristal. ¡Y hemos preparado una expedición a la isla!\n\nLa mayor parte de la expedición ya ha partido, pero la última nave de los goblins está lista para zarpar en breve.\n\n¡Si te das prisa, podrás alcanzarlos antes de que se vayan y unirte a nosotros!', '', '', '', '', '', '', 58162),
(84701, 'esMX', 'El Portavoz', 'Habla con Magni en Dornogal.', 'Así que hay alguien más que pasó por algo parecido a lo que yo viví. Pero no es lo mismo.\n\nTengo que hablar con él.', '', '', '', '', '', 'Habla con Magni en Dornogal.', 58162),
(84684, 'esMX', 'Carrera de Ratts', 'Rastrea a Ratts.', 'Vi a una vulpera actuando de forma muy sospechosa. Parecía... nerviosa. Creo que vi que llevaba un cuchillo sujeto a la cintura y su mirada rebosaba de magia negra.\n\nSe dio cuenta de que la estaba observando y huyó al instante. ¿Será una criminal buscada?\n\nSe le... cayó esto. Toma.', '', '', '', '', '', 'Investiga la gema extraña.', 58162),
(84680, 'esMX', 'Reanimación de rocas y piedras', '$1oa piedritas o piedras inquietas revividas, $2oa horrores sangresalada y la monstruosidad Sanguidra derrotados.', 'Los vrykuls que están atacando controlan elementales de sal y salmuera para que peleen contra sus enemigos.\n\nSi queremos contrarrestar su ofensiva, podemos controlarlos también.\n\nUsa este resucitador de rocas para liberar a los elementales que residen en las piedras de alrededor y transformarlos en aliados poderosos. Con su ayuda, venceremos esta amenaza vrykul.', '', '', '', '', '', '', 58162),
(84625, 'esMX', 'Cajón de festejo sorprendentemente prístino', 'Devuelve el cajón de festejo sorprendentemente prístino a Alyx.', '<Encontraste este cajón de suministros de festejo en la tumba sin nombre donde enterraste los huesos. Alyx agradecerá la devolución de los suministros.>', '', '', '', '', '', '', 58162),
(84547, 'esMX', 'Garantía de recuperación de inversión', 'Entrega la Kaja\'Cola vacía a Blinky Dedosgrasos en Cardumen de Naufragios.', '<Hasta una lata vacía de Kaja\'Cola tiene algo de valor. Tal vez a Blinky Dedosgrasos le interese.>', '', '', '', '', '', '', 58162),
(84506, 'esMX', 'Persecución de mascotas', 'Busca a Jepetto Jugarreta cerca del patio recreativo para mascotas.', '¡Hola, $gaventurero:aventurera;!\n\nEscuché a un grupo de domadores de mascotas de duelo que hablaba acerca de un bingo. Jepetto Jugarreta estaba entre ellos y parecía algo preocupado por su progreso.\n\n¿Por qué no te fijas si necesita ayuda?', '', '', '', '', '', 'Busca a Jepetto Jugarreta cerca del patio recreativo para mascotas.', 58162),
(84469, 'esMX', 'Bingo de mascotas de duelo', 'Resuelve los acertijos y encuentra las mascotas de duelo.', '¡Ah, hola! Escucha esto. Los grandes maestros domadores de mascotas de Pandaria han publicado un desafío que consiste en encontrar ciertas mascotas de duelo que aparecen en estas fascinantes tarjetas de bingo. \n\nTodo lo que hay que hacer es encontrar a las mascotas de los acertijos y anotarlas en las tarjetas de bingo, pero estas últimas dos son muy difíciles de hallar. Es fácil cuando se trata de mascotas normales, pero nosotros tenemos que buscar las versiones especiales de esas criaturas para completar las tarjetas.\n\nMmm... nadie dijo que pedir ayuda iba en contra de las reglas. ¿Qué dices? ¿Podrías darme una mano?', '', '', '', '', '', '', 58162),
(84432, 'esMX', 'Atraque de drakkars', 'Elimina a $1oa vrykul regasangre.', 'Estos vrykuls regasangre no tienen ningún respeto por nosotros ni por nuestra investigación. Aunque intentamos compartir nuestros descubrimientos, ¡nos atacaron! \n\nNo les importa que no pretendamos hacerle ningún daño a la isla, nos quieren fuera.\n\nPero no podemos irnos ahora. ¡Hay tanto por descubrir! Alguien tiene que dejarles claro que no pensamos retirarnos todavía y que deben dejarnos en paz.\n\nTenemos que mostrarles que nos defenderemos.', '', '', '', '', '', '', 58162),
(84252, 'esMX', 'La cumbre de la precisión', 'Usa la mochivoladora experimental para acceder a $4oa máquinas de sondeo y activarlas.', '¿Volar? Eso no es para mí.\n\nSally Aprietatuercas quería que yo activara varias máquinas de sondeo para controlar las corrientes de viento, pero es muy difícil, y me mareo en la altura. \n\nMe dan náuseas cada vez que lo intento.\n\nUsa la mochivoladora para activar las máquinas. ¡Te debo una!', '', '', '', '', '', 'Preséntate ante Sally Aprietatuercas en Cardumen de Naufragios.', 58162),
(84248, 'esMX', 'Un ritual de runas', 'Destruye $1oa runas de invocación y elimina a Inhyldir, la Maldita.', 'Fui a investigar una cueva cercana y me encontré con unos vrykuls regasangre que estaban conjurando algo... Algo que activó mis protocolos de mitigación de amenazas.\n\nSegún mis cálculos, si completan el ritual, sería un desastre para toda la isla.\n\n¡$n, tienes que ir a esa cueva y detener el ritual antes de que ocurra algo terrible!', '', 'Sus crímenes fueron tan grotescos que incluso su nombre ha sido borrado de todos los registros conocidos.', 'Inhyldir, la Maldita', '', '', '', 58162),
(84241, 'esMX', 'Defensa de la costa', 'Elimina $1oa ánima salatada y al campeón de las mareas Korval.', 'Esta tormenta no me impedirá llevar a cabo mi deber sagrado. ¡Debo defender esta cueva, cueste lo que cueste!\n\nAunque este nuevo cristal siga siendo un completo misterio, jamás comprenderemos sus secretos ni su relación con Beledar si permitimos que caiga en las garras de esos condenados que se arrastran desde el abismo del océano.\n\nResiste conmigo, $n. Juntos, defenderemos esta costa hasta nuestro último aliento.', '', 'Este campeón caído deambula por la Tumba Olvidada en busca de respuestas a preguntas perdidas hace mucho tiempo en la niebla del tiempo.', 'Campeón de las mareas Korval', '', '', '', 58162),
(84225, 'esMX', 'Ningún huevo sin romper', 'Elimina a $1oa cuidadores de huevos y $2oa huevos en eclosión.', 'Deberíamos correr, pero...\n\n¿Ves esos huevos ahí? Si esos monstruos los hacen eclosionar, este lugar estará plagado de cangrejos cuando se despeje la tormenta.\n\nUf, son demasiados para destruirlos a mano. ¡Necesitaremos ayuda!\n\nSuzie tiene muchos objetos útiles en el campamento. O tal vez mi asador funcione... No sé, adalid. ¡Busca algo para deshacerte de esos huevos!', '', '', '', '', '', '', 58162),
(84222, 'esMX', 'Asegura el perímetro', 'Elimina a $1oa enemigos raros en la Isla de las Sirenas.', 'Toda una variedad de criaturas peligrosas nos han atacado desde que levantamos nuestro campamento.\n\nSi bien mis tropas pueden encargarse de la mayoría de las amenazas, puede que solo tu pericia esté a la altura de algunas de las criaturas más poderosas.\n\nExplora la isla y elimina a todas las entidades poderosas que podrían poner en riesgo nuestro trabajo.', '', '', '', '', '', '', 58162),
(83932, 'esMX', 'Documentos históricos', 'Agrega $1oa notas y documentos que encuentres en la isla al diario de investigación.', '¿Te imaginas lo que significa poder acompañar a la capitana del cielo Elaena Lancekat en una aventura tan grande? ¡Esta es la clase de oportunidad que solo se presenta una vez en la vida!\n\nPero para escribir un libro sobre este viaje, tengo que recopilar información histórica sobre esta isla.\n\nQuizá puedas reunir las notas o los documentos que encuentres. ¡Cualquier cosa podría ser útil para conocer la historia de este lugar!', '', '', '', '', '', '', 58162),
(83764, 'esMX', 'Un gran poder conlleva un gran peligro', 'Busca artefactos peligrosos por el Foso Oreado y destrúyelos.', 'Algunas de las reliquias en poder de los nerubianos fueron resguardadas en unas bóvedas que se diseñaron especialmente para contenerlas en Dalaran. Eso es suficiente para imaginar lo peligrosas y poderosas que son.\n\nAhora que esas bóvedas desaparecieron, lo único que podemos hacer es destruirlas.\n\nEn retrospectiva, juntar tantos artefactos poderosos en un solo lugar parece haber sido un grave error... incluso si ese lugar era Dalaran.\n\nNo puedo confiarle a nadie más esta tarea, $n. Busca y destruye esos artefactos.', '', '', '', '', '', 'Vuelve con Lady Jaina Valiente en Playa Mansa, en la Isla de Dorn.', 58162),
(83763, 'esMX', 'Preservar el legado', 'Recoge objetos valiosos en el Foso Oreado.', 'La mayor amenazada ha sido neutralizada, $n, pero creo que todavía quedan otros artefactos importantes para nuestro legado, buenos y malos, en Azj-Kahet.\n\nA pesar del peligro que suponen, el conocimiento que contienen podría beneficiarnos a todos en el futuro. Además, no podemos permitir que los nerubianos saquen provecho de lo que ellos y Xal\'atath le hicieron a Dalaran.\n\nNo dejes ningún rincón del Foso Oreado sin explorar, $n.', '', '', '', '', '', 'Vuelve con Lady Jaina Valiente en Playa Mansa, en la Isla de Dorn.', 58162),
(83762, 'esMX', 'Masa crítica', 'Ayuda a Lady Jaina Valiente a desarmar la bomba de maná en el Foso Oreado.', 'Esto es exactamente lo que temía.\n\nLas notas de Thalen Tejecanto sobre la bomba de maná que diseñó para arrasar con Theramore estaban resguardadas en Dalaran. Pocos sabían sobre ellas.\n\nYo propuse destruirlas, pero los demás dijeron que si alguien volvía a construir una bomba como esa, necesitaríamos una manera de desarmarla.\n\nY, ahora, esas notas son un problema y una solución.\n\nPor suerte, yo misma leí esas notas, $n. Te guiaré para que puedas desarmar la bomba de maná.', '', '', '', '', '', '', 58162),
(83743, 'esMX', 'Guerra fría arcana', 'Viaja a Azj-Kahet y reúnete con Lady Jaina Valiente.', 'Vinieron algunos magos, pero... esperaba acudieran más al llamado a la acción de Aethas.\n\nPero tal vez era solo una ilusión.\n\nA pesar de todo lo que hicieron tú y Kalecgos en Alto en Pena, necesitamos más ayuda. A excepción del colgante de Kel\'Thuzad, el resto de los objetos que robaron los kóbolds eran artefactos con poderes mediocres.\n\nMientras tanto, se ha informado que hay objetos mágicos poderosos filtrándose por Azj-Kahet. ¡Eso quiere decir los nerubianos deben haber saqueado la zona del incidente de Dalaran antes de que llegáramos!\n\nTenemos que encontrar esos artefactos antes de que los usen en nuestra contra.', '', '', '', '', '', '', 58162),
(83359, 'esMX', 'Un camino destrozado por el tiempo', 'Derrota 5 jefes de banda o completa 5 calabozos de cronoviaje.', 'Alguien de tu pueblo me contó una extraña historia sobre el cataclismo que desgarró a Azeroth. En tus tierras, el impacto fue mayor debido a las maquinaciones de una criatura malvada llamada Alamuerte. \n\nViaja a través del tiempo y el espacio y enfréntate a él y otras amenazas.', '', '', '', '', '', '', 58162),
(83357, 'esMX', 'La prueba definitiva', 'Derrota a 5 jugadores mediante Encontrar duelo con un equipo de mascotas de nivel 25.', 'El vínculo entre nosotros y nuestras máquinas es muy parecido al que otros tienen con sus mascotas. ¡Tienes que estar en armonía con tus compañeros para poder lograr grandes cosas!\n\nDemuéstrame que puedes trabajar en equipo con tus mascotas. ¡Derrota a tus enemigos con su ayuda!', '', '', '', '', '', '', 58162),
(82787, 'esMX', 'Asignación especial: El ascenso de los colosales', 'Mata bestias colosales', 'MM', '', '', '', '', '', '', 58162),
(82711, 'esMX', 'Abismos: Objetos perdidos y encontrados', 'Recupera 3 pertenencias perdidas de Brann en los abismos que están por Khaz Algar.', 'Tengo un pedido un tanto personal, $n. Perdí algunas de mis herramientas en nuestras aventuras. Mi abrecartas de la suerte, mi brújula...\n\nY puede que ya lo hayas notado, pero estoy usando un sombrero diferente. ¡Este es un trapo viejo y andrajoso comparado con la preciosura que normalmente llevo en la cabeza!\n\n¿Podemos ir a investigar por algunos abismos y ver dónde dejé mis cosas?', '', '', '', '', '', '', 58162),
(82702, 'esMX', 'Un encuentro con amigos', 'Preséntate ante Alleria en Dornogal.', 'Así que Gallywix decidió mostrar su fea cara aquí... y parece que está bien organizado.\n\nDeberíamos informar a Alleria para saber cómo quiere manejarlo.', '', '', '', '', '', 'Preséntate ante Alleria en Dornogal.', 58162),
(82701, 'esMX', 'Murciélago contra el mundo', 'Mira la misión de exploración de Orweyna.', 'Mientras estaba explorando, oí y vi cosas que no entendí. \n\nTal vez si les describo mi experiencia a ti y a los goblins, se den cuenta de lo que significa.', '', '', '', '', '', '', 58162),
(82700, 'esMX', 'Diseñado para destruir', 'Destruye al MECA IV averiado.', 'Tenemos un problema de información, pero también tenemos un problema mecánico.\n\nSi te fijas por ahí, hay un gran meca averiado que está fuera de control. Nadie podrá descubrir nada mientras esa cosa esté en el camino.\n\nDeberíamos hacer algo al respecto.', '', 'La cuarta versión de la Máquina de Exterminación Cruel y Absoluta. Esta presenta algunas fallas graves en el sistema.', 'MECA IV averiado', '', '', 'Vuelve a ver a Orweyna a Punto de Oportunidad.', 58162),
(82699, 'esMX', 'Ey, ¿qué cuentas?', 'Interroga a goblins y busca pruebas en la Excavación Abismal para descubrir pistas', 'Es hora de socializar un poco. \n\nHay muchos goblins fuera de Punto de Oportunidad, en la Excavación Abismal. Oí a un par refunfuñando cuando empezaban su turno.\n\nVeamos si unas palabras bonitas hacen que suelten un poco la lengua.\n\nMientras andas por ahí, revisa los barriles de combustible usados. No me dejaban mirar dentro de los barriles llenos, pero acaban de dejar los usados por el lugar de trabajo.', '', '', '', '', '', 'Reúnete con Renzik en la Excavación Abismal.', 58162),
(82698, 'esMX', 'Averiadas y agresivas', 'Destruye las excavadoras averiadas.', 'Vi muchas máquinas en las cercanías, y parece que todas hacen un ruido tremebundo. Pero no escucho a la que oí en mi visión, al menos, no con claridad.\n\nDestruye las que estorban, pues no son más que una distracción.\n\nMientras tú silencias un poco el lugar, yo seguiré explorando.', '', '', '', '', '', 'Reúnete con Renzik en la Excavación Abismal.', 58162),
(82697, 'esMX', 'Bienes escasos', 'Busca a Haxle Brocas y dale un susto para acceder a la operación.', '¡Es una sorpresa muy grata verte aquí!\n\nEstá pasando algo trascendental en Punto de Oportunidad, pero es difícil saber de qué se trata sin acercarnos a los que están trabajando en el lugar. \n\nSé que Haxle está involucrado. Necesitaremos acceder a sus documentos para hacer averiguaciones sin problemas. \n\nÉl se dirige a Punto de Oportunidad. \n\nVe, síguelo y averigua si tiene algo que podamos usar. No te preocupes por el desorden... Sé que sabes ser $gdiscreto:discreta; cuando es necesario.\n\nY... también abandonar la discreción cuando es necesario.', '', 'Lleva un permiso laboral que permite acceder a las operaciones de Punto de Oportunidad.', 'Haxle Brocas', '', '', 'Reúnete con Gazlowe en Punto de Oportunidad.', 58162),
(82696, 'esMX', 'Ruidos en las minas', 'Reúnete con Orweyna en el Campamento Murroch en las Minas Resonantes.', 'Mi visión fue muy clara. Tengo que continuar con este trabajo.\n\nTengo que descubrir cómo podemos detener la propagación de la sangre negra, antes de que sea tarde para tu pueblo y para el mío.\n\nVeámonos en las Minas. Asumiré una forma que me permita ocultarme y escuchar sin que nadie se dé cuenta.', '', '', '', '', '', 'Reúnete con Orweyna en el Campamento Murroch en las Minas Resonantes.', 58162),
(82695, 'esMX', 'La voz', 'Defiende a Orweyna mientras medita.', 'Aquí es donde debo concentrarme. Oigo la voz de mi diosa, debe estar cerca.\n\nVoy a meditar para consultarle qué debo hacer. ¿Cómo puedo continuar esta misión sola? ¿Cómo puedo continuar con los demás?\n\nQuédate cerca. Quién sabe lo que puede aparecer mientras estoy concentrada.', '', '', '', '', '', '', 58162),
(82694, 'esMX', 'Solos pero unidos', 'Reúnete con Hannan en Cristalia para escuchar el plan.', 'No estoy ciega. Sé que están cansados y agotados, pero estamos muy cerca de averiguar si hay algo que podamos hacer frente a la sangre negra.\n\nLa importancia de lo que descubramos va más allá de Cristalia o el reino nerubiano. Si queremos buscar una solución, tenemos mucho trabajo por delante.\n\nPor ahora, será mejor que nos retiremos para recuperarnos. Busquemos un lugar lejos de estas criaturas.', '', '', '', '', '', 'Reúnete con Orweyna debajo de Beledar, junto al Inframar.', 58162),
(82693, 'esMX', 'Un obstáculo considerable', 'Derrota al behemoth costrasangre.', 'Algunas de estas criaturas son más fuertes que otras. Cuando teníamos toda nuestra energía y podíamos coordinar nuestros movimientos, no eran una amenaza. Pero ahora que hemos quedado separados y débiles, somos vulnerables. \n\nMi pueblo es resistente, pero no somos inmortales.\n\nHay una bestia en particular que es más grande que las demás. Es el principal obstáculo que impide que los haranir nos reagrupemos y recuperemos.\n\nMátala para que estemos a salvo.', '', 'Una bestia inusualmente grande fortalecida por la sangre que se ha filtrado.', 'Behemoth costrasangre', '', '', '', 58162),
(82692, 'esMX', 'El precio de una misión', 'Busca a los haranir acorralados y examina las flores extrañas.', 'No sé por qué has venido aquí, pero nos vendría bien tu ayuda. \n\nVinimos a investigar señales de sangre negra en esta área, pero nos encontramos con una cantidad abrumadora de criaturas. Hay muchos de los nuestros que siguen afuera.\n\nTú eres valiente y $gvigoroso:vigorosa;. Ve a buscar a mi pueblo y tráelos de regreso.\n\nTambién, si tienes la fuerza, presta atención a esas flores extrañas que crecen a partir de la sangre que se filtra en el suelo. Puede que sean la clave para encontrar una forma de combatir esta corrupción.', '', '', '', '', '', '', 58162),
(82691, 'esMX', 'Sin descanso', 'Mata a criaturas purulentas.', 'Todos seguimos a Orweyna a estas cuevas de la superficie porque creíamos en lo que todos estábamos haciendo. Pero esto... Nunca pensamos que sufriríamos tanto, ni que la búsqueda sería tan exhaustiva.\n\nPor ahora, solo necesitamos un lugar seguro para descansar. Mata a las criaturas del exterior que nos atacan, y así tendremos tranquilidad para ocuparnos de nuestra tarea.', '', '', '', '', '', '', 58162),
(82690, 'esMX', 'Sombras Tenaces', 'Vuelve al lugar donde Alleria percibió sangre negra en Cristalia.', 'Cuando nos enfrentamos a las fuerzas de Xal\'atath en Cristalia, pude percibir que había algo oscuro bajo la superficie. No se trataba de la Emisaria, pero no deja de perturbarme.\n\nHe aprendido que afrontar sola cada situación que surge no es siempre la mejor táctica. A veces, una líder tiene que tomar distancia para ver el campo de batalla completo.\n\nPor eso, debo pedirte que vayas a investigar.\n\nVe a Cristalia y averigua todo lo que puedas sobre esta fuerza misteriosa. No quiero volver a llevarme una sorpresa.', '', '', '', '', '', 'Vuelve al lugar donde Alleria percibió sangre negra en Cristalia.', 58162),
