(81650, 'esMX', 'Asignación especial: Resurgimiento titánico', '', '', '', '', '', '', '', '', 58162),
(81624, 'esMX', 'Orta, la Montaña Rota', '', '', '', '', '', '', '', '', 58162),
(81498, 'esMX', 'Componentes silvestres: Desfiladero Tembloroso', '', '', '', '', '', '', '', 'Vuelve a reunirte con Nazkena en el Bazar Umbrío.', 58162),
(81487, 'esMX', 'Destrucción de la falange: Hojas hiladas', '', '', '', '', '', '', '', '', 58162),
(81478, 'esMX', 'Reliquias de guerra: El Lago Rasgado', '', '', '', '', '', '', '', 'Vuelve a reunirte con Isanyx en Los Entramados.', 58162),
(80562, 'esMX', 'Delicia floreciente', 'Recoge $1oa hongos perennes en la Caverna Micomántica.', 'Muy pocos seguidores de la Luz se atreverían a intentar el plato que planeo hacer. Es una mezcla de especias tradicionales imperiales combinadas con la cosecha prohibida de los brotes de hongos cercanos.\n\nEste plato deleitará al paladar y recordará a uno de los espíritus aventureros que fundaron la Expedición Cristalia.\n\nViaja hasta la Caverna Micomántica cercana y reúne los brotes que necesito.', '', '', '', '', '', '', 58162),
(80395, 'esMX', 'Excavación elemental', '', '', '', '', '', '', '', '', 58162),
(80185, 'esMX', 'Preservación en solitario', 'Completa 12 rondas de Aleatorio en solitario.', 'Si luchas por tu cuenta, te harás más fuerte y valiente. Demuestra tus habilidades en solitario en pequeñas batallas y luego regresa conmigo.', '', '', '', '', '', '', 58162),
(53256, 'esMX', 'Donaciones de Arathi: Heliolito letal', '', '', '', '', '', '', '', '', 58162),
(43411, 'esMX', 'Se solicita al maestro', '', '', '', '', '', '', '', '', 58162),
(43410, 'esMX', 'Se solicita al maestro', '', '', '', '', '', '', '', '', 58162),
(10560, 'esMX', 'Venerado con Sha\'tar', 'A\'dal de la Ciudad de Shattrath quiere que seas $gvenerado:venerada; en Sha\'tar venciendo a las tropas de Kael\'thas dentro de El Castillo de la Tempestad.', '<El tono melódico y relajante proyectado por A\'dal se hace más quedo y sombrío.>$B$B<Te muestra la gran estructura naaru conocida como El Castillo de la Tempestad. Ahora está habitado por las tropas de Kael\'thas y su poder, utilizado con fines viles. A\'dal te promete tareas más importantes cuando hayas hecho tu parte para recuperar El Castillo de la Tempestad.>', '', '', '', '', '', '', 58162),
(10559, 'esMX', 'Venerado con Thrallmar', 'Nazgrel, de Thrallmar, en la Península del Fuego Infernal, quiere que seas $gvenerado:venerada; en Thrallmar luchando contra los orcos viles que hay dentro de Las Salas Arrasadas de la Ciudadela del Fuego Infernal.', 'Te has puesto a prueba una y otra vez, $c. Pero te aguardan más pruebas.$B$BSigue luchando contra la Horda vil dentro de Las Salas Arrasadas de la Ciudadela del Fuego Infernal y tu nombre será conocido para todos los seguidores de Thrall en esta tierra.', '', '', '', '', '', '', 58162),
(9617, 'esMX', 'Busca a los errantes', 'Habla con la teniente Correalba en El Retiro del Errante.', 'La teniente Correalba en El Retiro del Errante ha convocado una reunión con todos los cazadores en estado de entrar en acción. Te beneficiaría mucho buscarla, $n. Es una antorcha de sabiduría para los de nuestra profesión.$B$BEl Retiro del Errante se encuentra al sur de la Ciudad de Lunargenta.', '', '', '', '', '', '', 58162),
(1708, 'esMX', 'Coral férreo', 'Lleva 20 piezas de coral férreo a Klockmort Palmalicate en Forjaz.', 'Quiero probar las nuevas técnicas de Furen Barbalarga en mi propia armadura. Y como tú ayudaste a Furen y él me ayudó a mí, seguro que te gustará ver la armadura terminada.$B$BPara terminar la pieza necesito un coral muy especial, coral abrasador. Solo crece en un lugar, a lo largo de la costa sur del Puerto de Menethil, en Los Humedales.$B$BTráeme suficiente coral abrasador y estaré listo para trabajar en la armadura. Date prisa, $n. ¡Tengo tantas ganas de empezar que me estoy mordiendo las uñas!', '', '', '', '', '', '', 58162);
